def run(value_list):
    """
    Calculates the average State and local income tax rate, net of federal tax benefits between 2017-2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    data = []
    for item in value_list:
        if item['category'] == 'State and local income tax rate, net of federal tax benefits':
            try:
                data.append(float(item['number_value']))
            except (ValueError, TypeError):
                pass

    if not data:
        return (0.0, '')

    average = sum(data) / len(data)
    return (round(average, 2), '')

def run(value_list):
    """
    Calculates the average RSUs vested from the provided list.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average RSUs vested,
        rounded to two decimal places.
    """
    vested_rsus = []
    for item in value_list:
        if item['category'] == 'Vested' and item['header1'] == 'RSUs':
            vested_rsus.append(item['number_value'])

    if not vested_rsus:
        return (0.00, '')

    average = sum(vested_rsus) / len(vested_rsus)
    return (round(average, 2), '')

def run(value_list):
    """
    Calculates the average of 'Revenues from sale of services' from the provided value list.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the average revenue (float) and the scale (string).
    """
    revenues = []
    for item in value_list:
        if item['category'] == 'Revenues from sale of services':
            revenues.append(item['number_value'])

    if not revenues:
        return (0.00, '')

    average = sum(revenues) / len(revenues)

    if average == 0.00:
        return (0.00, '')

    if average < 1000000:
        scale = 'thousand'
    elif average < 100000000:
        scale = 'million'
    elif average < 10000000000:
        scale = 'billion'
    else:
        scale = ''

    return (round(average, 2), scale)

