def run(value_list):
    gross_profit_2019 = []
    gross_profit_2018 = []
    gross_profit_2017 = []

    for item in value_list:
        if item['category'] == 'Gross profit':
            if item['header2'] == '2019':
                gross_profit_2019.append(float(item['number_value']))
            elif item['header2'] == '2018':
                gross_profit_2018.append(float(item['number_value']))
            elif item['header2'] == '2017':
                gross_profit_2017.append(float(item['number_value']))

    total_gross_profit = sum(gross_profit_2019) + sum(gross_profit_2018) + sum(gross_profit_2017)
    average_gross_profit = total_gross_profit / 3

    return (round(average_gross_profit, 2), '')

